import {BrowserRouter as Router,Switch, Route} from 'react-router-dom';
import './App.css';
import Homepage from './Homepage/Homepage';
import Login from './Login/Login';

function App() {
  return (
   <>
   <Router>
   <Switch>

   <Route path="/"><Login/></Route>
   <Route path="/home"><Homepage/></Route>
   </Switch>


   </Router>


   </>
  );
}

export default App;
